// deleteApi.js

export const deleteCall = (callId, token) => {
    return fetch(`http://192.168.0.39:3010/call/${callId}`, {
      method: 'DELETE',
      headers: {
        'Content-Type': 'application/json',
        Authorization: token,
      },
    })
      .then(response => response.json())
      .catch(error => console.error('Erro ao excluir chamado:', error));
  };
